script: |
  super -f text -I q12193.spq | sort > q12193.out

inputs:
  - name: q12193.spq
    data: |
      SELECT ALL - 3 - - COUNT ( * ), COUNT ( * ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q12193.out
    data: |
      6	9
